import * as React from 'react'
import Button from '@mui/material/Button'
import ManagementClients from '../imgs/backgroundManagementClients.png'

const Dashboard = ({ 
    title,
    image,
    }) =>{

  return (
    <div>
      <Button
        id="basic-button"
        onClick={''}
        sx={{ color:'#ffffff',backgroundRepeat: 'no-repeat', backgroundSize:'cover',
              width:'66vw', height:'100px', backgroundImage: `url(${image})`,  
    }}
      >
        <h3>{title}</h3>
      </Button>
    </div>
  )
}

export default Dashboard
